def upsample(data: DataFrame, column: String, seed: Long) : DataFrame = {
    import org.apache.spark.sql.functions.col, org.apache.spark.sql.functions.lit
    // "true" usually needs to be oversampled. Start with that assumption
    val dtrue = data.filter(col(column)===lit(1))
    val trues = dtrue.count()
    val falses = data.count() - trues
    println("\t\tUpsampling by a factor of "+(falses-trues)*1.0/trues)
    // but do check it.
    if(falses>=trues) {
        // If so, oversample true results (keeping at least one copy of each true result)
        return data.union(dtrue.sample(withReplacement=true,fraction=(falses-trues)*1.0/trues,seed=seed))
    }
    else {
        // Otherwise, oversample false results in the same way.
        val dfalse = data.filter(col(column)===lit(0))
        return data.union(dfalse.sample(withReplacement=true,fraction=(trues-falses)*1.0/falses,seed=seed))
    }

}

def runPipelineOnData(fulldata: DataFrame, pipeline: Pipeline, PMMLClassNamePrefix: String, labelcol: String, seed1: Long = 8675309, seed2: Long = 42, seed3: Long = 314159265) : PipelineModel = {

    val splits = fulldata.randomSplit(Array(0.8, 0.2), seed1)
    val trainingData = splits(0)//upsample(splits(0),labelcol, seed2)
    val testingData = splits(1)//upsample(splits(1),labelcol, seed3)

    val pipelineModel = pipeline.fit(trainingData)
    val trainpredictions = pipelineModel.transform(trainingData)

    val predictions = pipelineModel.transform(testingData)

    val evaluator = new MulticlassClassificationEvaluator().setLabelCol(labelcol)
    val evaluator2 = new BinaryClassificationEvaluator().setLabelCol(labelcol)

    val train_accuracy = evaluator.evaluate(trainpredictions)

    println("\t\tTrain Error = " + (1.0 - train_accuracy) + "%")

    val accuracy = evaluator.evaluate(predictions)

    println("\t\tTest Error = " + (1.0 - accuracy) + "%")

    println("\t\tTrain AUC = "+evaluator.evaluate(trainpredictions))

    println("\t\tTest AUC = "+evaluator.evaluate(predictions))

    val realdata_predictions = pipelineModel.transform(splits(1))

    var tp = (realdata_predictions.filter($"fraud"===1)).filter($"prediction"===1).count()
    println("\t\tTrue positives: "+tp)
    var fp = (realdata_predictions.filter($"fraud"===0)).filter($"prediction"===1).count()
    println("\t\tFalse positives: "+fp)
    var tn = (realdata_predictions.filter($"fraud"===0)).filter($"prediction"===0).count()
    println("\t\tTrue negatives: "+tn)
    var fn=(realdata_predictions.filter($"fraud"===1)).filter($"prediction"===0).count()
    println("\t\tFalse negatives: "+fn)

    val fileName="/common_shared/pmml/IRISDemo.ImportedModel."+PMMLClassNamePrefix+".pmml"

    println("\t\tExporting the model to PMML file " + fileName)

    val file = new File(fileName)

    val pmmlBuilder = new org.jpmml.sparkml.PMMLBuilder(fulldata.schema, pipelineModel).buildFile(file)

    return pipelineModel

}

